:root {
  --block-radius: 0px !important;
  --table-radius: 0px !important;
  --input-radius: 0px !important;
}

/* Hides the final AutoEvalColumn */
#llm-benchmark-tab-table table td:last-child,
#llm-benchmark-tab-table table th:last-child {
    display: none;
}
/* Limit the width of the first AutoEvalColumn so that names don't expand too much */
table td:first-child,
table th:first-child {
    max-width: none; /* Remove any max-width or set it to a higher value */
    overflow: visible; /* Set overflow to visible to ensure the content is not hidden */
    white-space: normal; /* Allow the text to wrap */
}

table {
    table-layout: auto; /* Change from fixed to auto if necessary */
    overflow-x: auto; /* Enable horizontal scrolling if the table is too wide */
    display: block; /* Set display to block for table to behave like a block element */
}

/* Full width space */
.gradio-container {
    max-width: 95%!important;
    font-family: Open Sans,sans-serif;
    line-height: 1.75em !important;
}

/* Text style and margins */
.markdown-text {
    font-size: 16px !important;
}
#models-to-add-text {
    font-size: 18px !important;
}
#citation-button span {
    font-size: 16px !important;
}
#citation-button textarea {
    font-size: 16px !important;
}
#citation-button > label > button {
    margin: 6px;
    transform: scale(1.3);
}
#search-bar-table-box > div:first-child {
    background: none;
    border: none;
}

#search-bar {
    padding: 0px;
}
.tab-buttons button {
    font-size: 20px;
}
.tab-buttons {
    padding-top: 40px;
}

/* Center Tabs */
.tab-buttons > div > div:nth-child(2) {
    justify-content: center;
}

/* Filters style */
#filter_type{
    border: 0;
    padding-left: 0;
    padding-top: 0;
}
#filter_type label {
    display: flex;
}
#filter_type label > span{
    margin-top: var(--spacing-lg);
    margin-right: 0.5em;
}
#filter_type label > .wrap{
    width: 103px;
}
#filter_type label > .wrap .wrap-inner{  
    padding: 2px;
}
#filter_type label > .wrap .wrap-inner input{
    width: 1px;
}
#filter-columns-type{
    border:0;
    padding:0.5;
}
#filter-columns-size{
    border:0;
    padding:0.5;
}
#box-filter > .form{
    border: 0
}

#intro {
    padding: 40px 0;
    border: 1px solid var(--border-color-primary);
}

#intro > div {
    padding-left: 2em;
    padding-right: 2em;
    min-width: 0px !important;
}

.image_header {
    display: flex;
    gap: 15px;
    align-items: center;
}


p {
    font-weight: 400;
    font-style: normal;
    font-size: 14px;
    line-height: 1.75em !important;
}

.button {
    border: 1px solid #174DA3;
    font-family: IBM Plex Mono,monospace;
    background: none;
    padding: 5px 15px;
    color: #174DA3 !important;
    position: relative;
    font-size: 14px;
    font-weight: 500;
    transition: background-color .15s ease;
    display: inline-flex;
    align-items: center;
    text-decoration: none !important;
    line-height: 1.75em !important;
}

.button:hover {
    cursor: pointer;
    background: #EBEEF4;
}

#llm-benchmark-tab-table-button {
    border-top-right-radius: unset !important;
    border-top-left-radius: unset !important;
    font-size: 18px !important;
    font-weight: 500 !important;
}

label {
    background: unset !important;
    border-radius: 0 !important;
    box-shadow: unset !important;
}

label > input {
    border-radius: 0 !important;
}

form {
    border-radius: 0 !important;
}

.principle_header {
    padding: 10px 20px;
    background-color: #EBEEF4;
    border: 1px solid var(--border-color-primary);
}

.technical_requirements {
    margin-top: -17px;
    gap: 0px;
    align-items: stretch;
}

.technical_requirements > div {
    gap: 0px;

}

.technical_requirements > div > div.form {
    border: unset !important;
}

.border_mid > div {
    border-left: 1px solid var(--border-color-primary);
    border-right: 1px solid var(--border-color-primary);
}

.border_bot > div {
    border-left: 1px solid var(--border-color-primary);
    border-right: 1px solid var(--border-color-primary);
    border-bottom: 1px solid var(--border-color-primary);
}

@media only screen and (max-width: 1200px) {
  .empty {
    visibility: hidden;
    display: none;
  }

}

@media only screen and (max-width: 800px) {
  .empty {
    visibility: hidden;
    display: none;
  }

  #intro {
    flex-direction: column;
    gap: 48px;
  }
}

.principle_icon {
    max-height:24px;
}

.github_icon {
    max-height:24px; 
    padding-right: 1em;
}

@media (prefers-color-scheme: dark) {
  .principle_header {
    background-color: var(--block-background-fill);
  }

  .button {
    border: 1px solid var(--color-accent);
    color: var(--color-accent) !important;
  }

  .principle_icon {
    filter: brightness(2);
  }

  .github_icon {
    filter: brightness(2);
  }
}

